  angular.module('ldLocalApi', []);
  angular.module('ldApi').factory('apiHttp', [
    '$http',
    function ($http) {
      var apiDataMethod, apiNonDataMethod, urlWithPath;
      urlWithPath = function (path) {
        return [
          'http://api.' + upfront.variables.apiDomain,
          path.replace(/^\/*/, '')
        ].join('/');
      };
      apiNonDataMethod = function (method) {
        return function (path, config) {
          return $http[method](urlWithPath(path), config);
        };
      };
      apiDataMethod = function (method) {
        return function (path, data, config) {
          return $http[method](urlWithPath(path), data, config);
        };
      };
      return {
        get: apiNonDataMethod('get'),
        'delete': apiNonDataMethod('delete'),
        post: apiDataMethod('post'),
        put: apiDataMethod('put')
      };
    }
  ]);
  angular.module('ldApi').factory('authedHttp', [
    'apiHttp',
    'session',
    function (apiHttp, session) {
      var authedHttp, configWithAccessToken, httpMethod, httpfyPromise, method, wrapMethod;
      authedHttp = {};
      wrapMethod = function (method) {
        var indexOfConfig;
        indexOfConfig = method.length - 1;
        return function () {
          var args, config, promise;
          args = Array.prototype.slice.call(arguments);
          config = args[indexOfConfig];
          promise = session.accessToken().then(function (accessToken) {
            args[indexOfConfig] = configWithAccessToken(config, accessToken);
            return method.apply(this, args);
          });
          return httpfyPromise(promise, config);
        };
      };
      for (httpMethod in apiHttp) {
        method = apiHttp[httpMethod];
        authedHttp[httpMethod] = wrapMethod(method);
      }
      configWithAccessToken = function (config, accessToken) {
        if (config == null) {
          config = {};
        }
        config.params || (config.params = {});
        config.params['access_token'] = accessToken;
        return config;
      };
      httpfyPromise = function (promise, config) {
        promise.success = function (fn) {
          return httpfyPromise(promise.then(function (response) {
            return fn(response.data, response.status, response.headers, config);
          }), config);
        };
        promise.error = function (fn) {
          return httpfyPromise(promise.then(null, function (response) {
            return fn(response.data, response.status, response.headers, config);
          }), config);
        };
        return promise;
      };
      return authedHttp;
    }
  ]);
  angular.module('ldApi').service('cookies', Cookies = function () {
    function Cookies() {
      if (upfront.variables.frontendDomain !== '') {
        this.domain = '.' + upfront.variables.frontendDomain;
      } else {
        this.domain = '';
      }
    }
    Cookies.prototype.get = function (name) {
      return unescape(document.cookie.replace(new RegExp('(?:(?:^|.*;)\\s*' + escape(name).replace(/[\-\.\+\*]/g, '\\$&') + '\\s*\\=\\s*([^;]*).*$)|^.*$'), '$1')) || null;
    };
    Cookies.prototype.set = function (name, value) {
      if (!name) {
        false;
      }
      document.cookie = '' + escape(name) + '=' + escape(value) + '; domain=' + this.domain + '; path=/';
      return true;
    };
    Cookies.prototype.remove = function (name) {
      return document.cookie = '' + escape(name) + '=; expires Thu, 01 Jan 1970 00:00:00 GMT; path=/';
    };
    return Cookies;
  }());
